import React from 'react';

const styles = {
    option: {
        'textTransform': 'capitalize'
    }
};

function CategoryItem({category}) {
    return(
        <option style={styles.option} onClick={e => console.log(e.target.value)}>{category.toLowerCase()}</option>
    )
}

export default CategoryItem;
